import logo from './logo.svg';
import './App.css';
import Gallery from './components/Gallery.js'
import Footer from './components/Footer.js'


function App() {
  return (
    <div className="App">
    <Switch>
      <Gallery></Gallery>
      <Footer></Footer>
    </Switch>
    </div>
  );
}

export default App;
